import React from 'react';
import './App.css';
import styled from 'styled-components';
import Header from './components/head';
import Footer from './components/foot';

const Container = styled.div`

  display:flex;
  color:'black'; 
  background-color:'#F9F9F9'; 
  height:100%;
  width:100%;
  justify-content: center;
  align-items: center;

`;

const Wrapper = styled.div`

  grid-template-columns: repeat(4, minmax(0%, 50%));
  gap:10px;
  background-color:red; 
  height:59%;
  width:65% 
`;

function App() {
  return (
    // <div className="App"  style={{display:'flex', backgroundColor:'black', flexDirection:'column', marginBottom:0}}>
      <div style={{display:'flex', flex:1, flexDirection:'column', height:'100%'}}> 
        <Header/>
          <Container>
            <Wrapper style={{ backgroundColor:"red", height:"59%", width:"65%", display:'grid', }} >
              <div style={{height:'47%', width:'23%', backgroundColor:'gray', borderColor:'black', borderWidth:'10px'}}/>
              <div style={{height:'47%', width:'23%', backgroundColor:'green', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{height:'47%', width:'23%', backgroundColor:'yellow', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{height:'47%', width:'23%', backgroundColor:'purple', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{height:'47%', width:'23%', backgroundColor:'blue', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{height:'47%', width:'23%', backgroundColor:'black', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{height:'47%', width:'23%', backgroundColor:'white', borderColor:'black', borderWidth:'1px'}}/>
              <div style={{height:'47%', width:'23%', backgroundColor:'pink', borderColor:'black', borderWidth:'1px'}}/>
            </Wrapper>
          </Container>
        <Footer/>
      </div>


    // </div>
  );
}

export default App;
